export let DisplayPokemons = ({pokemons}) => {
    if (pokemons === undefined) return
    return (
        <div className="container">
            {/*<img src={pokemonImage} ></img>*/}
            <ol>Pokemons: </ol>
            {pokemons.map(p => {

                return <li key={p.number}>
                    <h4>name {p.name}:</h4>
                    <h5>{p.attack}</h5>
                    <hr/>
                </li>
            })}
        </div>
    );
}
